		</div>
		<div class="functionItems" style="font-family:Helvetica, Arial, 微软雅黑, 黑体, sans-serif;font-size:medium;background-color:#FFFFFF;">
			<div class="item col-3">
				<img class="pc2" src="http://www.epson.com.cn/common/Style2/product/EPSON_L360/prd_11.png" style="width:363px;height:auto;" alt="image" />
				<h3 style="font-size:20px;font-weight:normal;">
