				</h3>
				<p style="font-size:16px;color:#666666;">
					采用爱普生原装墨水，色彩艳丽，实现 高达5760dpi分辨率；智能墨滴变换技术， 打印质量更细腻。
				</p>
			</div>
			<div class="item col-3">
				<img class="pc2" src="http://www.epson.com.cn/common/Style2/product/EPSON_L360/prd_12.png" style="width:363px;height:auto;" alt="image" />
				<h3 style="font-size:20px;font-weight:normal;">
					速度提升 事半功倍
				</h3>
				<p style="font-size:16px;color:#666666;">
