				</h3>
				<p style="font-size:16px;color:#666666;">
					采用爱普生微压电打印技术，无需加热， 无臭氧等有害物质释放，洁净输出，营造健康 绿色的办公环境。
				</p>
			</div>
			<div class="item col-3">
				<img class="pc2" src="http://www.epson.com.cn/common/Style2/product/EPSON_L360/prd_15.png" style="width:363px;height:auto;" alt="image" />
