		<div class="clearFix" style="border:0px;font-family:Helvetica, Arial, 微软雅黑, 黑体, sans-serif;font-size:medium;background-color:#FFFFFF;">
		</div>
		<p style="font-family:Helvetica, Arial, 微软雅黑, 黑体, sans-serif;color:#666666;background-color:#FFFFFF;">
			*1：此数据是使用ISO/IEC FCD24712样张测试，单套墨水可打印黑色4000页或彩色6500页，所标称页数为近似值。以上数据均来源于爱普生实验室，因环境而异，与实际使用数据可能存在差异。 1分2是指黑白单页打印成本，4分钱是指彩色单页打印成本，是由耗材建议零售价（黑色墨水：48元/支，彩色墨水：60元/支）和相应可打印页数计算所得。若用户每天打印10页，则一年不用换墨水。
		</p>
		<p style="font-family:Helvetica, Arial, 微软雅黑, 黑体, sans-serif;color:#666666;background-color:#FFFFFF;">
			*2：使用爱普生测试样张测试。（针对本产品，爱普生测试样张即为eMemo样张）。
		</p>
		<p style="font-family:Helvetica, Arial, 微软雅黑, 黑体, sans-serif;color:#666666;background-color:#FFFFFF;">
			*3：依据ISO/IEC24734显示的，基于默认单面模式的Office Category Test的ESAT平均值测定。
		</p>
		<p style="font-family:Helvetica, Arial, 微软雅黑, 黑体, sans-serif;color:#666666;background-color:#FFFFFF;">
			*4：此打印速度采用爱普生测试样张，使用4x6英寸爱普生高质量光泽照片纸进行有边距打印获得（针对本产品，爱普生测试样张即为4x6英寸样张。
